import React from "react";

const headerStyle = {
  color: '#f3be85',
  padding: '20px',
  display: 'flex',
  justifyContent: 'space-between'
}


const Header = () => {
  return (
    <div>
      <style jsx>{`
          .header {
             color: #f3be85;
             padding: 20px;
             display: flex;
             justifyContent: space-between;
             background: #595959;
          }
          ul {

            list-style:none;
            display: flex;
            height: 20px;
          }

          ul li {
            margin: 0px 12px;
            color: white;
            cursor: pointer;
          }

           ul li:hover {
             color: #f3be85;
           }

           ul li a {
            text-decoration: none;
            margin: 10px;
          }


      `}</style>
      <header className="header" style={headerStyle}>

        <h1>ViajaEnVan</h1>
        <ul>
          <li>Inicio</li>
          <li>Destinos</li>
          <li>Servicios</li>
          <li>Cotactenos</li>
        </ul>
      </header>
    </div>
  );
};

export default Header;
